import axios from 'axios'
import { connect } from 'react-redux'

const Login = (props) => {
	// 先试试给服务器发送请求 成功
	const sendRequest = async () => {
		const respones = await axios.get('/login/yuchen')
		console.log(respones)
	}

	// 试试action和reducer
	const handleSub = (props) => {
		console.log(props.default)
	}

	return (
		<div>login
			<div>
				<button onClick={sendRequest} >Send Request</button>
				<hr />
				<div className='ui container'>
					<form>
					<div>
						<label>User name here: </label>
						<input name='username'></input>
					</div>
					<div style={{margin: 20+'px'}}></div>
					<div>
						<label>Ur pwd here: </label>
						<input name='pwd'></input>
					</div>
					<button onSubmit={handleSub}>Create User</button>
					</form>
				</div>
			</div>
		</div>
	)
}

const mapStateToProps = (state, preProps) => {
	return {default: state.default}
}

export default connect(mapStateToProps)(Login)
